"use strict";
var helpers = require("syracuse-core/lib/helpers");
var TestPage = require("syracuse-ui/lib/tests/testPage").TestPage;
var sheetPage = require("syracuse-ui/lib/fusion/article/sheetPage");
var tests = [require("syracuse-ui/lib/tests/convergence/cleanerSource/oamk")];

function ConvergenceCleanerTest() {}

exports.ConvergenceCleanerTest = helpers.defineClass(ConvergenceCleanerTest, TestPage, {
	loadBox: function() {
		this.$item.$layout = {
			$items: []
		};
		for (var ii = 0, jj = tests.length; ii < jj; ii++) {
			var test = tests[ii];
			var $clean = syra_site.layoutUpdater.cleanConvergenceSetting(test.$layout);
			//debugger;
			var test = JSON.stringify($clean);
			//debugger;
		}
		TestPage.prototype.loadBox.call(this);
	}
});